import React, { Component } from "react";
import axios from "axios";
import { Redirect } from "react-router-dom";

class HandleDates extends Component {
    constructor(props) {
        super(props);

        this.state = {
        }
    }

    componentDidMount() {
        axios
            .get('http://localhost:1337/dates/')
            .then((res) => {
                this.setState({ dates: res })
            })
        console.log(this.state.dates)
    }

    onSubmitHandle = (e) => {
        e.preventDefault()

    }

    render() {

        if (this.props.aUserGroup !== "admin") {
            return (<Redirect to="/" />)
        }

        return (
            <div>
                <div>
                    <table>
                        <thead>
                            <tr>
                                <th>
                                    Dates and times
                                </th>
                                <th>
                                    Salons
                                </th>
                            </tr>
                        </thead>
                        <tbody>
                            {this.state.dates.map((date) =>
                                <tr>
                                    <td>
                                        {date}
                                    </td>
                                    <td>
                                        {date}
                                    </td>
                                </tr>
                            )}
                        </tbody>
                    </table>
                </div>
                <div className={"addFormMain"}>
                    <div className={"addFormWrapper"}>
                        <div className={"addFormContainer"}>
                            <form className={"addForm"} onSubmit={this.onSubmitHandle}>
                                <div className={"addFormButtonDiv"}>
                                    <button type="submit" className={"addFormButton"} onClick={this.onSubmitHandle}>Add week</button>
                                </div>
                            </form>
                        </div>
                    </div>
                </div>
            </div>
        )
    }
}

export default HandleDates;
